import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import API from '../services/api';
import Logo from './Logo';

const Login = () => {
  const [formData, setFormData] = useState({
    email: '',
    password: ''
  });
  const [error, setError] = useState('');
  const [loading, setLoading] = useState(false);
  const navigate = useNavigate();

  const { email, password } = formData;

  const onChange = e => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const onSubmit = async e => {
    e.preventDefault();
    setLoading(true);
    try {
      const res = await API.post('/api/auth/login', { email, password });
      localStorage.setItem('token', res.data.token);
      navigate('/dashboard');
    } catch (err) {
      setError(err.response?.data?.message || 'Login failed');
    }
    setLoading(false);
  };

  return (
    <div className="login-container fade-in">
      <div className="login-card">
        <div className="login-header">
          <Logo size="lg" showText={true} />
          <h3 style={{margin: '15px 0 5px 0', color: 'white'}}>Agent Management Portal</h3>
          <p style={{margin: 0, opacity: 0.9}}>CSTech Infosolutions Private Limited</p>
        </div>
        
        <div className="login-body">
          {error && (
            <div style={{
              padding: '12px 15px',
              background: '#fff0f0',
              color: '#D10000',
              borderRadius: '6px',
              marginBottom: '20px',
              border: '1px solid #ffcccc'
            }}>
              {error}
            </div>
          )}
          
          <form onSubmit={onSubmit} style={{width: '100%'}}>
            <div className="form-group">
              <label className="form-label">Email Address</label>
              <input
                type="email"
                name="email"
                value={email}
                onChange={onChange}
                required
                className="form-control"
                placeholder="Enter your email"
              />
            </div>
            
            <div className="form-group">
              <label className="form-label">Password</label>
              <input
                type="password"
                name="password"
                value={password}
                onChange={onChange}
                required
                className="form-control"
                placeholder="Enter your password"
              />
            </div>
            
            <button 
              type="submit" 
              disabled={loading}
              className="btn btn-primary"
              style={{width: '100%', padding: '12px'}}
            >
              {loading ? (
                <>
                  <span className="loading-spinner"></span>
                  Signing in...
                </>
              ) : (
                'Sign In'
              )}
            </button>
          </form>
          
          <div style={{
            marginTop: '20px',
            padding: '15px',
            background: '#fff5f5',
            borderRadius: '6px',
            border: '1px solid #ffd5d5'
          }}>
            <h6 style={{margin: '0 0 10px 0', color: '#D10000', textAlign: 'center'}}>Demo Credentials:</h6>
            <div style={{textAlign: 'center', fontSize: '14px', color: '#666'}}>
              <div>Email: admin@example.com</div>
              <div>Password: admin123</div>
            </div>
          </div>
          
          <div className="footer">
            <div style={{fontSize: '12px', color: '#666', marginTop: '20px'}}>
              Made by Rudhr Chauhan - Assignment for CSTech Infosolutions Private Limited
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Login;
